import React from 'react';
import { CartProvider } from './context/CartContext';
import Navbar from './components/Navbar';
import Home from './pages/Home';
import './index.css';

function App() {
  return (
    <CartProvider>
      <div className="App">
        <Navbar />
        <Home />
      </div>
    </CartProvider>
  );
}

export default App;
